every_frame:
  every_frame_start:
    # set up stack / preserve variables
    stwu sp, -52(sp)
    mflr r0
    stw r0, 56(sp)
    stw r3, 8(sp)
    stw r4, 12(sp)
    stw r5, 16(sp)
    # sp+20, for 12 bytes, is a Vec3 used to change Waluigi's position

    # grab our "mailbox" variable, LA-Basic[74] (1000004A), using the getInt function
    bl get_mailbox

    cmpwi r3, 1  # if message is 1,
    beq- pre_final_smash
    cmpwi r3, 2  # if message is 2,
    beq- enter_final_smash
    cmpwi r3, 3  # if message is 3,
    beq- exit_final_smash
    cmpwi r3, 4  # if message is 4,
    beq- finish_final_smash
    b every_frame_end

  pre_final_smash:
    # set the magnifying glass of all 4 characters to NOT show
    li r3, 0
    bl set_all_magnifying_glass

    # pause the stage and other stuff
    mr r3, r31
    li r4, 1
    bl unnamed_pause_func

    # clear mailbox value (no need to maintain an "in-pre-final-smash state")
    li r4, 0
    b set_var

  enter_final_smash:
    # freeze pause camera
    li r5, 1
    bl set_camera_freeze

    # hide stage layer
    li r5, 0
    bl set_layer_disp

    # get camera instance pointer
    lwz r3, -0x41A8(r13)

    # disable zooming (fixes training mode pause)
    # call setDisableZoomStart/[CameraController]/(cm_camera_controller.o)
    lis r12, 0x8009
    ori r12, r12, 0xD250
    mtctr r12
    bctrl

    lwz r3, 0x60(r31)
    li r4, 10
    bl set_camera

    bl push_stage_camera

    li r3, 0
    bl set_visibility_stage_effect

    # this space in section 6 is used to store the postion before the final smash scene
    lis r3, 0       [R_PPC_ADDR16_HA(112, 6, "loc_330")]
    addi r3, r3, 0  [R_PPC_ADDR16_LO(112, 6, "loc_330")]

    mr r4, r31
    lwz r4, 0x60(r4)
    lwz r4, 0x18(r4)

    # call getPos/[soPostureModuleSimple]/(so_posture_module_impl.o)
    # (note that this stores into r3)
    lis r12, 0x8073
    subi r12, r12, 0x564
    mtctr r12
    bctrl

    # load the vector (0.0, 3000.0, 0.0) onto the stack
    addi r4, sp, 20
    li r3, 0
    stw r3, 0(r4)
    stw r3, 8(r4)
    lis r3, 0x453b
    ori r3, r3, 0x8000
    stw r3, 4(r4)

    mr r3, r31
    lwz r3, 0x60(r3)
    lwz r3, 0x18(r3)

    # call setPos/[soPostureModuleSimple]/(so_posture_module_impl.o)
    lis r12, 0x8073
    subi r12, r12, 0x1768
    mtctr r12
    bctrl

    # set the magnifying glass of all 4 characters to NOT show
    li r3, 0
    bl set_all_magnifying_glass

    # remove all graphic effects in order to get rid of the final smash aura
    # this mimics Captain Falcon's FS
    # this calls 807A48A0 removeAll/[soEffectModuleImpl]/(so_effect_module_impl.o)
    lwz r3, 0x60(r31)
    lwz r3, 0xD8(r3)
    lwz r3, 0x88(r3)
    li r4, 8
    lwz r12, 0(r3)
    lwz r12, 0x5C(r12)
    mtctr r12
    bctrl

    # load new mailbox value (5 = in final smash)
    li r4, 5
    b set_var

  exit_final_smash:
    # unfreeze pause camera
    li r5, 0
    bl set_camera_freeze

    li r3, 1
    bl set_visibility_stage_effect

    bl pop_stage_camera

    # cancel the final smash scene
    bl reset_camera

    # unhide stage layer
    li r5, 1
    bl set_layer_disp

    # get camera instance pointer
    lwz r3, -0x41A8(r13)

    # reenable zooming (fixes training mode pause)
    # call setDisableZoomEnd/[CameraController]/(cm_camera_controller.o)
    lis r12, 0x8009
    ori r12, r12, 0xD2B0
    mtctr r12
    bctrl

    # grab our saved position from section 6 from before the scene so we can restore it
    lis r4, 0       [R_PPC_ADDR16_HA(112, 6, "loc_330")]
    addi r4, r4, 0  [R_PPC_ADDR16_LO(112, 6, "loc_330")]

    mr r3, r31
    lwz r3, 0x60(r3)
    lwz r3, 0x18(r3)

    # call setPos/[soPostureModuleSimple]/(so_posture_module_impl.o)
    lis r12, 0x8073
    subi r12, r12, 0x1768
    mtctr r12
    bctrl

    # set the magnifying glass of all 4 characters to show
    li r3, 1
    bl set_all_magnifying_glass

    # reactivate the final smash aura
    # this mimics Captain Falcon's FS
    # this calls 807A479C - reqEmit/[soEffectModuleImpl]/(so_effect_module_impl.o)
    lwz r3, 0x60(r31)
    lwz r3, 0xD8(r3)
    lwz r3, 0x88(r3)
    li r4, 72
    li r5, 8
    lwz r12, 0(r3)
    lwz r12, 0x54(r12)
    mtctr r12
    bctrl

    # load new mailbox value (0 = not in final smash)
    li r4, 0
    b set_var

  finish_final_smash:
    # undo stage (and other stuff) pause
    mr r3, r31
    li r4, 0
    bl unnamed_pause_func

    li r4, 0
    b set_var

  set_var:
    # set our mailbox variable by calling setInt (807ACA00)
    # r4 contains its new value
    bl set_mailbox

  every_frame_end:
    # restore variables
    lwz r3, 8(sp)
    lwz r4, 12(sp)
    lwz r5, 16(sp)
    lwz r0, 56(sp)
    mtlr r0
    lwz sp, 0(sp)

    # restore old code
    li r0, 0

    blr

on_deactivate: # called on match end - needed to clean up the camera freeze!
  on_deactivate_start:
    # set up stack / preserve variables
    stwu sp, -20(sp)
    mflr r0
    stw r0, 24(sp)
    stw r3, 8(sp)
    stw r4, 12(sp)
    # 16(sp) stores the mailbox variable

    bl get_mailbox
    stw r3, 16(sp)

    # we should only clean up the following stuff if we're exiting during the final smash scene itself
    # however, we still need to clean up the stage freeze potentially - see the jump
    # normally, we'd check for 5 here, since that signifies we're in the final smash.
    # however, the PSA sets the flag to 4 on exit for the action override in which the tennis is happening
    # the exit routines actually DO run when you exit the match, funnily enough. we need to check for
    # 4 as well as 5 as a result later
    cmpwi r3, 3
    bne- on_deactivate_undo_stage_freeze

    li r3, 1
    bl set_visibility_stage_effect

    bl pop_stage_camera

    bl reset_camera

    # undo the camera freeze.
    # setting and unsetting the camera freeze seems to actually work like a stack.
    # for every time you call this function with r4 = 1, you need to call it as many times
    # with r4 = 0. so hopefully it was called with 1 only once!!
    li r5, 0
    bl set_camera_freeze

    # reenable all disabled layers
    li r5, 1
    bl set_layer_disp

    # get camera instance pointer
    lwz r3, -0x41A8(r13)

    # reenable zooming (fixes training mode pause)
    # call setDisableZoomEnd/[CameraController]/(cm_camera_controller.o)
    lis r12, 0x8009
    ori r12, r12, 0xD2B0
    mtctr r12
    bctrl

  on_deactivate_undo_stage_freeze:
    # only need to clean up if we were in any phase of the final smash (see earlier comment about the values)
    lwz r3, 16(sp)
    cmpwi r3, 3
    blt+ on_deactivate_end

    # undo stage (and other stuff) pause
    # this intentionally is called after reset_camera because of a byte of flags (0x8059FF80+0x465) that is affected by both
    mr r3, r31
    li r4, 0
    bl unnamed_pause_func

  on_deactivate_done:
    # set our mailbox variable to 0  so we don't do this a second time
    # onDeactivate appears to be called like 3 times over the course of ending a match
    # the "stack" can go negative if you call too many times with 0, so it's important
    # that the calls to this function are perfectly matched
    li r4, 0
    bl set_mailbox

  on_deactivate_end:
    lwz r3, 8(sp)
    lwz r4, 12(sp)
    lwz r0, 24(sp)
    mtlr r0
    lwz sp, 0(sp)
    blr

get_mailbox:
  get_mailbox_start:
    # set up stack / preserve variables
    stwu sp, -16(sp)
    mflr r0
    stw r0, 20(sp)
    stw r4, 8(sp)
    stw r27, 12(sp)

    # get character-related pointer needed to call getInt/setInt function
    lwz r27, 0x60(r31)
    lwz r27, 0xD8(r27)
    lwz r27, 0x64(r27)

    # grab our "mailbox" variable, LA-Basic[74] (1000004A), using the getInt function
    mr r3, r27
    lis r4, 0x1000
    addi r4, r4, 0x004A
    lwz r12, 0(r27)
    lwz r12, 0x18(r12)
    mtctr r12
    bctrl

  get_mailbox_end:
    # r3 now contains the value of the variable
    lwz r4, 8(sp)
    lwz r27, 12(sp)
    lwz r0, 20(sp)
    mtlr r0
    lwz sp, 0(sp)
    blr

set_mailbox:
  set_mailbox_start:
    # set up stack / preserve variables
    stwu sp, -16(sp)
    mflr r0
    stw r0, 20(sp)
    stw r5, 8(sp)
    stw r27, 12(sp)

    # get character-related pointer needed to call getInt/setInt function
    lwz r27, 0x60(r31)
    lwz r27, 0xD8(r27)
    lwz r27, 0x64(r27)

    # set our mailbox variable by calling setInt (807ACA00)
    mr r3, r27
    lwz r12, 0(r27)
    lwz r12, 0x1C(r12)
    lis r5, 0x1000
    addi r5, r5, 0x004A
    mtctr r12
    bctrl

  set_mailbox_end:
    lwz r5, 8(sp)
    lwz r27, 12(sp)
    lwz r0, 20(sp)
    mtlr r0
    lwz sp, 0(sp)
    blr

set_camera_freeze:
  set_camera_freeze_start:
    # set up stack / preserve variables
    stwu sp, -16(sp)
    mflr r0
    stw r0, 20(sp)
    stw r3, 8(sp)
    stw r4, 12(sp)

    stw r5, 12(sp)

    # get camera instance pointer
    lwz r3, -0x41A8(r13)

    li r4, 7

    # call getCameraController/[CameraController]/(cm_camera_controller.o)
    lis r12, 0x8009
    ori r12, r12, 0xCA00
    mtctr r12
    bctrl

    lwz r4, 12(sp)

    # call setFreezeMode/[cmPhotoController]/(cm_controller_photo.o)
    lis r12, 0x800A
    ori r12, r12, 0x9600
    mtctr r12
    bctrl

  set_camera_freeze_end:
    lwz r3, 8(sp)
    lwz r4, 12(sp)
    lwz r0, 20(sp)
    mtlr r0
    lwz sp, 0(sp)
    blr

set_layer_disp:
  set_layer_disp_start:
    # set up stack / preserve variables
    stwu sp, -20(sp)
    mflr r0
    stw r0, 24(sp)
    stw r3, 8(sp)
    stw r4, 12(sp)
    stw r27, 16(sp)

    # setLayerDispStatus/[gfSceneRoot]/(gf_3d_scene.o)
    lis r12, 0x8000,
    ori r12, r12, 0xD234
    mtctr r12

    # get pointer to current scene?
    lis r27, 0x8059
    ori r27, r27, 0xFF80
    lwz r27, 0(r27)

    # for some reason, falcon calls this function with 0, 3, 2, and 6
    # here, we call it without 2, which allows articles to still display
    # r5 will contain whether to turn these layers on (0 or 1)
    li r4, 0
    mr r3, r27
    bctrl

    li r4, 3
    mr r3, r27
    bctrl

    li r4, 6
    mr r3, r27
    bctrl

  set_layer_disp_end:
    lwz r3, 8(sp)
    lwz r4, 12(sp)
    lwz r27, 16(sp)
    lwz r0, 24(sp)
    mtlr r0
    lwz sp, 0(sp)
    blr

set_all_magnifying_glass:
  set_all_magnifying_glass_start:
    # set up stack / preserve variables
    stwu sp, -32(sp)
    mflr r0
    stw r0, 36(sp)
    stw r3, 8(sp)  # passed-in - 1 to set LA-Bit[25] true, 0 for false
    stw r4, 12(sp)
    stw r27, 16(sp)  # loop counter
    # 20(sp) stores current fighter pointer
    # 24(sp) stores chosen function (onFlag/offFlag)
    # 28(sp) stores current fighter's LA-Bit space pointer

    # 807ACD10 00000034 807ACD10 0 onFlag/[soWorkManageModuleImpl]/(so_work_manage_module_impl.o)
    # 807ACD44 00000034 807ACD44 0 offFlag/[soWorkManageModuleImpl]/(so_work_manage_module_impl.o)

    lwz r27, 0x60(r31)
    lwz r27, 0xD8(r27)
    lwz r27, 0x64(r27)
    lwz r27, 0x00(r27)

    lis r4, 0x8062
    addi r4, r4, 0x3324
    stw r4, 20(sp)

    lwz r12, 0(r31)

    cmpwi r3, 1
    bne+ off_flag

    lwz r12, 0x50(r27) # onFlag/[soWorkManageModuleImpl]/(so_work_manage_module_impl.o)
    b store_flag_func

  off_flag:
    lwz r12, 0x54(r27) # offFlag/[soWorkManageModuleImpl]/(so_work_manage_module_impl.o)

  store_flag_func:
    stw r12, 24(sp)

    li r27, 0

  player_loop:
    lwz r3, 20(sp)
    addi r4, r3, 0x244
    stw r4, 20(sp)

    lwz r3, 0(r3)

    # must be pointer-like
    lis r4, 0x8000
    cmplw r3, r4
    blt- before_next_loop
    lis r4, 0xA000
    cmplw r3, r4
    bge- before_next_loop

    lwz r3, 0x60(r3)
    lwz r3, 0xD8(r3)
    lwz r3, 0x64(r3)
    stw r3, 28(sp)

    # LA-Bit[25]
    lis r4, 0x1200
    addi r4, r4, 25

    lwz r12, 24(sp)
    mtctr r12
    bctrl

    lwz r3, 28(sp)

    # LA-Bit[28]
    lis r4, 0x1200
    addi r4, r4, 28

    lwz r12, 24(sp)
    mtctr r12
    bctrl

    lwz r3, 28(sp)

    # don't change LA-Bit[26] if LA-Bit[7] is true. in the PSA, Waluigi should have set this a frame or two
    # beforehand - this is a poor man's way to identify him lol.
    lis r4, 0x1200
    addi r4, r4, 7
    lis r12, 0x807A      # isFlag/[soWorkManageModuleImpl]/(so_work_manage_module_impl.o)
    ori r12, r12, 0xCCDC #
    mtctr r12
    bctrl

    cmpwi r3, 1
    beq- before_next_loop

    lwz r3, 28(sp)

    # LA-Bit[26]
    lis r4, 0x1200
    addi r4, r4, 26

    lwz r12, 24(sp)
    mtctr r12
    bctrl

  before_next_loop:
    addi r27, r27, 1
    cmpwi r27, 4
    blt+ player_loop

  set_all_magnifying_glass_end:
    lwz r3, 8(sp)
    lwz r4, 12(sp)
    lwz r27, 16(sp)
    lwz r0, 36(sp)
    mtlr r0
    lwz sp, 0(sp)
    blr
